export default function CountChar(){
    function countChar(numSeq){

        var seqArr = Array.from(String(numSeq), Number)
        var countArr = [10]
        for(let i=0; i<10; i++){
            countArr[i] = 0
        }

        console.log(countArr)
        // console.log(seqArr)

        for(let i=0; i<seqArr.length; i++){
            var curIndex = seqArr[i] - 1
            let curCount = countArr[curIndex]
            
            countArr[curIndex] = curCount++
        }

        console.log(countArr)

        //output result array
        var outputdiv = document.getElementById('outputdiv')
        outputdiv.innerHTML = numSeq
    }

    return(
        <div>
            <input type={"number"} placeholder={"Enter your number sequence"} onChange={(e) => {countChar(e.target.value)}}/>
            <p className="output" id="outputdiv"></p>
        </div>
    )
}
